INSERT INTO classes (id, date, time, duration, class_type, instructor, training_partners, techniques_focused, rolling_partners, your_submissions, partner_submissions, cardio_rating, user_id, created_at) VALUES (17, '2025-10-21 00:00:00'::timestamp, '06:00', 60, 'No Gi', 'Coach Sid', NULL, 'Side control defense  Ball up. Think head to their chest when in bottom position. Allows you to stay safe and look for sweep. ', ARRAY['Joe & Andrew.']::text[], 1, 1, 4, 38, '2025-10-21 05:19:13.816133'::timestamp) ON CONFLICT (id) DO NOTHING;
INSERT INTO classes (id, date, time, duration, class_type, instructor, training_partners, techniques_focused, rolling_partners, your_submissions, partner_submissions, cardio_rating, user_id, created_at) VALUES (18, '2025-10-21 00:00:00'::timestamp, '12:00', 60, 'Gi', 'Coach Spud', NULL, 'Side control defense.   Fighting for frames from bottom. Push forearm into neck to create space. Framing the hip with elbow.  Can potentially finish with cutting arm bar or shoulder lock throwing leg over the back.   Live rolls started from bottom side control and working way out.   Also did some stand up wrestling. Grabbing lapel and sleeve, snap down like wet blanket, back step and trip.   Or snap down into single leg. ', ARRAY['Coach Spud and Mikhail']::text[], 0, 1, 2, 38, '2025-10-21 05:21:54.179339'::timestamp) ON CONFLICT (id) DO NOTHING;
INSERT INTO classes (id, date, time, duration, class_type, instructor, training_partners, techniques_focused, rolling_partners, your_submissions, partner_submissions, cardio_rating, user_id, created_at) VALUES (19, '2025-10-23 00:00:00'::timestamp, '06:00', 60, 'No Gi', 'Coach Sid', NULL, 'Side control attack/defense   Top player: fight to not let opponent elbow frame the hip   Bottom player: fight to get the hip frame.   Wrestling: stand up. Get inside position. Collar tie and tricep grip. Turn the bus as they push forward and step back to let them fall. As they posture up, shoot the double. ', ARRAY['Andrew and Brendan']::text[], 0, 0, 4, 38, '2025-10-22 20:59:42.515814'::timestamp) ON CONFLICT (id) DO NOTHING;
INSERT INTO classes (id, date, time, duration, class_type, instructor, training_partners, techniques_focused, rolling_partners, your_submissions, partner_submissions, cardio_rating, user_id, created_at) VALUES (2, '2025-09-23 00:00:00'::timestamp, '12:00', 60, 'Gi', 'Spud', NULL, 'Bottomed side control - frame turn to side get knee in ', ARRAY['Spud']::text[], 0, 9, 1, 1, '2025-09-23 04:52:44.81527'::timestamp) ON CONFLICT (id) DO NOTHING;
