INSERT INTO classes (id, date, time, duration, class_type, instructor, training_partners, techniques_focused, rolling_partners, your_submissions, partner_submissions, cardio_rating, user_id, created_at) VALUES (21, '2025-10-24 00:00:00'::timestamp, '06:00', 60, 'Gi', 'Self Run ', NULL, 'Stand up. 50/50 in Gi with snapdowns with sweeps or into double leg takedowns.   Situational rolls. Top and bottom player. Guard pass and guard retention. Top player to pass guard and solidify. Bottom player to retain guard and sweep. ', ARRAY['Andrew','Joe and Coach Sid']::text[], 0, 2, 2, 38, '2025-10-23 21:13:03.185163'::timestamp) ON CONFLICT (id) DO NOTHING;
