INSERT INTO classes (id, date, time, duration, class_type, instructor, training_partners, techniques_focused, rolling_partners, your_submissions, partner_submissions, cardio_rating, user_id, created_at) VALUES (25, '2025-10-28 00:00:00'::timestamp, '18:00', 60, 'No Gi', 'Coach Sid', NULL, 'Sweep from half guard with half butterfly hook to land on mount. If they post, then get the underhook and go the other way.   Key detail: to ensure they can''t post, cup the tricep.   Finish with a submission by crocodile walking up when you land on-top and walk up to extend arms/catch a wrist and arm bar, cutting arm bars, kimura are all there', ARRAY['Justin']::text[], 2, 0, 2, 38, '2025-10-28 04:05:14.140669'::timestamp) ON CONFLICT (id) DO NOTHING;
