INSERT INTO classes (id, date, time, duration, class_type, instructor, training_partners, techniques_focused, rolling_partners, your_submissions, partner_submissions, cardio_rating, user_id, created_at) VALUES (30, '2025-10-30 00:00:00'::timestamp, '06:00', 60, 'No Gi', 'Sid', NULL, 'How to get out of Kesa side control.  1. Get into loaded position 2. Use left hand to reach over op. Allows space to get right elbow to the floor.  3. Bring knee to the back.   4. Hip thrust up and back towards op to allow knee to come into rib cage.  5. Work from there. Keep balled up.', ARRAY[]::text[], 0, 0, 3, 50, '2025-10-30 21:40:05.288572'::timestamp) ON CONFLICT (id) DO NOTHING;
